query.pigql:
q = load "${App.Datasets.ServiceCase_tp.FullyQualifiedName}";
q = filter q by IsClosed=="true";
hasArticle = filter q by 'ArticleVersion' > 0;  
c = group hasArticle by 'Priority', q by 'Priority'; 
c = foreach c generate count(hasArticle)/count(q)  as 'avg_AttachedRate', hasArticle['Priority'] as 'Priority'; c = order c by 'avg_AttachedRate' {{cell(static_1.selection, 0, "value").asString()}};
